import React from 'react'

export const Quote = ( { quote, author } ) => {
    return (
        <blockquote className='bloquote text-end' >
            <p className='mb-1' > { quote } </p>
            <footer className='blockquote-footer' > { author } </footer>
        </blockquote>
    )
}
